                   <th class="bg-green-200 border text-left px-8 py-4">
                     Remarks
                   </th>
                   <th class="bg-green-200 border text-left px-8 py-4">
                     Disposal Date
                   </th>
                   <th class="bg-green-200 border text-left px-8 py-4">
                     Action
                   </th>
                 </tr>
               </thead>
               <tbody>
                 {ndcData &&
                   ndcData.map((tm) => (
                     <tr key={tm.dak.dakidNo}>
                       <td class="bg-green-50 border text-left ">
                         {tm.dak.dakidNo}
                       </td>
                       <td class="bg-green-50 border text-left ">{tm.me}</td>
                       <td class="bg-green-50 border text-left ">
                         {tm.amountOutstanding}
                       </td>
                       <td class="bg-green-50 border text-left ">
                         {" "}
                         {tm.ndcDate}
                       </td>

                       <td class="bg-green-50 border text-left ">
                         {" "}
                         {tm.recordStatus}
                       </td>
                       <td class="bg-green-50 border text-left ">
                         {tm.remarks}
                       </td>

                       <td class="bg-green-50 border text-left  ">
                         {/* Aud : {tm.auditorName} */}

                         {tm.aoDate}
                       </td>
                       <td class="bg-green-50 border text-left  ">
                         <button
                           key={tm.id}
                           id={tm.id}
                           onClick={(e) => printNdc(e, tm.id)}
                         >
                           Download NDC
                         </button>
                       </td>
                     </tr>
                   ))}
               </tbody>
               <tbody>
                 {ndcData.length === 0 && (
                   <tr>
                     <td colspan="4" align="center">
                       No NDCs Available{" "}
                     </td>
                   </tr>
                 )}
               </tbody>
             </table>
           </div>
         </div>
       </div>
     </div>
   );
 };

 export default withRouter(Pro);
